[void] [System.Reflection.Assembly]::LoadWithPartialName("System.Drawing")
[void] [System.Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms")
$Global:ValidColors = ([System.Drawing.Brushes].GetProperties([System.Reflection.BindingFlags]::Static -bor [System.Reflection.BindingFlags]::Public) | ForEach-Object { $_.Name })

function New-SpongeBobMeme
{

    [CmdletBinding()]
    param (
        # Meme Text
        [Parameter(Mandatory)]
        [string]
        $Text,

        # # Background Color
        # [Parameter()]
        # [ArgumentCompleter( {
        #         [OutputType([System.Management.Automation.CompletionResult])]  # zero to many
        #         param(
        #             [string] $CommandName,
        #             [string] $ParameterName,
        #             [string] $WordToComplete,
        #             [System.Management.Automation.Language.CommandAst] $CommandAst,
        #             [System.Collections.IDictionary] $FakeBoundParameters
        #         )

        #         $Global:ValidColors | Where-Object { $_ -like "*$WordToComplete*" }
        #     })]
        # [ValidateScript(
        #     {
        #         $_ -in ($Global:ValidColors)
        #     }
        # )]
        # [string]
        # $BackgroundColor = "WhiteSmoke",

        # Forground Color
        [Parameter()]
        [ArgumentCompleter( {
                [OutputType([System.Management.Automation.CompletionResult])]  # zero to many
                param(
                    [string] $CommandName,
                    [string] $ParameterName,
                    [string] $WordToComplete,
                    [System.Management.Automation.Language.CommandAst] $CommandAst,
                    [System.Collections.IDictionary] $FakeBoundParameters
                )

                $Global:ValidColors | Where-Object { $_ -like "*$WordToComplete*" }
            })]
        [ValidateScript(
            {
                $_ -in ($Global:ValidColors)
            }
        )]
        [string]
        $ForegroundColor = "Black"
    )

    begin
    {
        # Load jpg into memory
        $base64 = ""
        $bytes = [System.Convert]::FromBase64String($base64)
        $memoryStream = [System.IO.MemoryStream]::new($bytes)
        $spongeBobBMP = [System.Drawing.Bitmap]::new($memoryStream)
        $memoryStream.Dispose()

        # Create bitmap to hold text and Spongebob
        $outBMP = [System.Drawing.Bitmap]::new($spongeBobBMP.Width, $spongeBobBMP.Height * 1.5)

        # Rectangle to draw text in
        $rectF = [System.Drawing.RectangleF]::new(0, $spongeBobBMP.Height, $spongeBobBMP.Width, $spongeBobBMP.Height * 0.5)

        # Create a new graphic object and set parameters
        $graphics = [System.Drawing.Graphics]::FromImage($outBMP)
        $graphics.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::AntiAlias
        $graphics.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
        $graphics.PixelOffsetMode = [System.Drawing.Drawing2D.PixelOffsetMode]::HighQuality
        $graphics.TextRenderingHint = [System.Drawing.Text.TextRenderingHint]::AntiAliasGridFit

        # .net format object
        $format = [System.Drawing.StringFormat]::new()
        $format.Alignment = [System.Drawing.StringAlignment]::Center
        $format.LineAlignment = [System.Drawing.StringAlignment]::Center

        # Font Parameters
        $font = "Tahoma"
        $fontSize = $spongeBobBMP.Height / 10

        # Prep for memeing
        $graphics.FillRectangle([System.Drawing.Brushes]::$BackgroundColor, 0, 0, $outBMP.Width, $outBMP.Height)
        $graphics.DrawImage($spongeBobBMP, 0, 0)
    }

    process
    {
        Write-Output "Hot memes, coming up..."
        # Make the meme
        $stupidText = Format-StringStupid $Text
        $graphics.DrawString($stupidText, [System.Drawing.Font]::new($font, $fontSize), [System.Drawing.Brushes]::$ForegroundColor, $rectF, $format)

        # Put the image in the clipboard

        [System.Windows.Forms.Clipboard]::SetImage($outBMP)
    }

    end
    {
        $graphics.Dispose()
    }
}
